import React from "react";
import "./App.css";
import Nav from "./Nav";
import Main from "./Main";
import NavTop from "./NavTop";
import Projects from "./Projects";
import Footer from "./Footer";
import { Link} from "react-router";

function App() {
  return (
    <div className="header">
      <NavTop />
      <div class="vl"></div>
      <Nav />
      <div className="App">
        {/* <Main /> */}
        <Projects />

      </div>

      <Footer />
    </div>
  );
}

export default App;
